import{_ as a,c as t,o,ag as s}from"./chunks/framework.Ds6Eueu6.js";const m=JSON.parse('{"title":"DROP TYPE","description":"","frontmatter":{},"headers":[],"relativePath":"docs/7x/ref_guide/sql_commands/DROP_TYPE.md","filePath":"docs/7x/ref_guide/sql_commands/DROP_TYPE.md"}'),i={name:"docs/7x/ref_guide/sql_commands/DROP_TYPE.md"};function n(d,e,r,l,p,c){return o(),t("div",null,e[0]||(e[0]=[s('<h1 id="drop-type" tabindex="-1">DROP TYPE <a class="header-anchor" href="#drop-type" aria-label="Permalink to &quot;DROP TYPE&quot;">​</a></h1><p>Removes a data type.</p><h2 id="synopsis" tabindex="-1"><a id="section2"></a>Synopsis <a class="header-anchor" href="#synopsis" aria-label="Permalink to &quot;&lt;a id=&quot;section2&quot;&gt;&lt;/a&gt;Synopsis&quot;">​</a></h2><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>DROP TYPE [IF EXISTS] &lt;name&gt; [, ...] [CASCADE | RESTRICT]</span></span></code></pre></div><h2 id="description" tabindex="-1"><a id="section3"></a>Description <a class="header-anchor" href="#description" aria-label="Permalink to &quot;&lt;a id=&quot;section3&quot;&gt;&lt;/a&gt;Description&quot;">​</a></h2><p><code>DROP TYPE</code> will remove a user-defined data type. Only the owner of a type can remove it.</p><h2 id="parameters" tabindex="-1"><a id="section4"></a>Parameters <a class="header-anchor" href="#parameters" aria-label="Permalink to &quot;&lt;a id=&quot;section4&quot;&gt;&lt;/a&gt;Parameters&quot;">​</a></h2><p>IF EXISTS : Do not throw an error if the type does not exist. WarehousePG issues a notice in this case.</p><p>name : The name (optionally schema-qualified) of the data type to remove.</p><p>CASCADE : Automatically drop objects that depend on the type (such as table columns, functions, operators), and in turn all objects that depend on those objects.</p><p>RESTRICT : Refuse to drop the type if any objects depend on it. This is the default.</p><h2 id="examples" tabindex="-1"><a id="section5"></a>Examples <a class="header-anchor" href="#examples" aria-label="Permalink to &quot;&lt;a id=&quot;section5&quot;&gt;&lt;/a&gt;Examples&quot;">​</a></h2><p>Remove the data type <code>box</code>;</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>DROP TYPE box;</span></span></code></pre></div><h2 id="compatibility" tabindex="-1"><a id="section6"></a>Compatibility <a class="header-anchor" href="#compatibility" aria-label="Permalink to &quot;&lt;a id=&quot;section6&quot;&gt;&lt;/a&gt;Compatibility&quot;">​</a></h2><p>This command is similar to the corresponding command in the SQL standard, apart from the <code>IF EXISTS</code> option, which is a WarehousePG extension. But note that much of the <code>CREATE TYPE</code> command and the data type extension mechanisms in WarehousePG differ from the SQL standard.</p><h2 id="see-also" tabindex="-1"><a id="section7"></a>See Also <a class="header-anchor" href="#see-also" aria-label="Permalink to &quot;&lt;a id=&quot;section7&quot;&gt;&lt;/a&gt;See Also&quot;">​</a></h2><p><a href="./ALTER_TYPE.html">ALTER TYPE</a>, <a href="./CREATE_TYPE.html">CREATE TYPE</a></p><p><strong>Parent topic:</strong> <a href="./../sql_commands/sql_ref.html">SQL Commands</a></p>',19)]))}const u=a(i,[["render",n]]);export{m as __pageData,u as default};
